(1, '2015-12-10 11:06:29', '2015-12-10 11:27:51', 'K2', '1.1.1', 1, '通过具体的例子，描述软件中的缺陷会以什么样的方式损害个人、损害环境或者损害公司利益', 1),
(2, '2015-12-10 11:15:32', '2015-12-10 11:28:09', 'K2', '1.1.2', 1, '区分引起缺陷的根本原因及其影响', 1),
(3, '2015-12-10 11:16:26', '2015-12-10 11:28:26', 'K2', '1.1.3', 1, '通过举例的方式说明为什么需要测试', 1),
(4, '2015-12-10 11:16:45', '2015-12-10 13:06:30', 'K2', '1.1.4', 1, '描述为什么测试是质量保证的一部分，通过举例说明测试是如何提高软件质量的', 1),
(5, '2015-12-10 11:17:24', '2015-12-10 13:15:58', 'K2', '1.1.5', 1, '通过举例来理解和比较术语错误、缺陷、故障、失效的概念以及相应的定义', 1),
(6, '2015-12-10 11:18:45', '2015-12-10 13:14:42', 'K1', '1.2.1', 1, '认识测试的总体目标', 1),
(7, '2015-12-10 11:19:04', '2015-12-10 11:28:57', 'K2', '1.2.2', 1, '举例说明软件生命周期中不同阶段的测试目标', 1),
(8, '2015-12-10 11:19:23', '2015-12-10 11:29:08', 'K2', '1.2.3', 1, '区分测试与调试的不同', 1),
(9, '2015-12-10 11:19:42', '2015-12-10 13:13:44', 'K2', '1.3.1', 1, '说明测试的七个基本原则', 1),
(10, '2015-12-10 11:20:00', '2015-12-10 13:15:12', 'K1', '1.4.1', 1, '认识从计划开始到结束过程的五个基本测试活动和各自的任务', 1),
(11, '2015-12-10 11:20:27', '2015-12-10 13:14:57', 'K1', '1.5.1', 1, '认识影响测试成功与否的心理因素', 1),
(12, '2015-12-10 11:20:46', '2015-12-10 11:29:19', 'K2', '1.5.2', 1, '对比测试人员和开发人员的思维方式的差异', 1),
(13, '2015-12-10 11:23:37', '2015-12-10 11:29:26', 'K2', '2.1.1', 1, '应用具体项目和产品类型的例子解释在开发生命周期中开发、测试活动与工作产品之间的关系', 2),
(14, '2015-12-10 11:23:59', '2015-12-10 13:12:58', 'K1', '2.1.2', 1, '知道必须根据项目背景和产品特征来选择软件开发的模型', 2),
(15, '2015-12-10 11:24:22', '2015-12-10 13:13:15', 'K1', '2.1.3', 1, '理解在任何生命周期模型中良好的测试应具备的特征', 2),
(16, '2015-12-10 11:24:40', '2015-12-10 13:07:53', 'K2', '2.2.1', 1, '比较不同测试级别之间的区别：测试的主要目的、典型的测试对象、典型的测试目标（功能性的或结构性的）、相关的工作产品、测试的人员、识别缺陷和失效的种类', 2),
(17, '2015-12-10 11:24:57', '2015-12-10 13:13:29', 'K2', '2.3.1', 1, '通过举例比较四种不同的软件测试类型（功能测试、非功能测试、结构测试和与变更相关的测试）', 2),
(18, '2015-12-10 11:25:23', '2015-12-10 13:07:14', 'K1', '2.3.2', 1, '明白功能测试和结构测试可以应用在任何测试级别', 2),
(19, '2015-12-10 11:25:52', '2015-12-10 13:08:13', 'K2', '2.3.3', 1, '根据非功能需求来识别和描述非功能测试的类型', 2),
(20, '2015-12-10 11:26:20', '2015-12-10 13:07:37', 'K2', '2.3.4', 1, '根据对软件系统结构或构架的分析来识别和描述测试的类型', 2),
(21, '2015-12-10 11:30:13', '2015-12-10 11:30:13', 'K2', '2.3.5', 1, '描述确认测试和回归测试的目的', 2),
(22, '2015-12-10 11:30:34', '2015-12-10 11:30:34', 'K2', '2.4.1', 1, '比较维护测试（一个现存系统的测试）与一个新的应用软件的测试在测试类型、测试的触发和测试规模等方面的区别', 2),
(23, '2015-12-10 11:31:00', '2015-12-10 11:31:00', 'K1', '2.4.2', 1, '识别维护测试的原因（由于修改、移植或退役等因素）', 2),
(24, '2015-12-10 11:31:44', '2015-12-10 11:31:44', 'K2', '2.4.3', 1, '描述回归测试和变更的影响分析在软件维护中的作用', 2),
(25, '2015-12-10 11:32:34', '2015-12-10 11:32:34', 'K1', '3.1.1', 1, '了解可以通过不同的静态技术来检查软件工作产品的质量', 3),
(26, '2015-12-10 11:32:56', '2015-12-10 11:32:56', 'K2', '3.1.2', 1, '描述了在评估软件工作产品中运用静态技术的重要性和它的价值', 3),
(27, '2015-12-10 11:36:59', '2015-12-10 11:36:59', 'K2', '3.1.3 ', 1, '结合测试对象、缺陷类型来说明静态测试技术与动态测试技术之间的不同，以及这些技术在软件生命周期中的作用', 3),
(28, '2015-12-10 11:37:35', '2015-12-10 11:37:35', 'K1', '3.2.1', 1, '理解典型的正式评审过程中的阶段、角色和职责定义', 3),
(29, '2015-12-10 11:37:59', '2015-12-10 11:37:59', 'K2', '3.2.2', 1, '解释不同类型评审的区别：非正式评审、技术评审、走查和审查', 3),
(30, '2015-12-10 11:38:29', '2015-12-10 11:38:29', 'K2', '3.2.3 ', 1, '解释影响评审成功的主要因素', 3),
(31, '2015-12-10 11:38:49', '2015-12-10 11:38:49', 'K1', '3.3.1', 1, '理解通过静态分析能够识别的典型缺陷和错误，并与评审和动态测试之间进行比较', 3),
(32, '2015-12-10 11:39:16', '2015-12-10 11:39:16', 'K2', '3.3.2 ', 1, '举例描述静态分析的主要优点', 3),
