(34, '2015-12-10 11:40:38', '2015-12-10 11:40:38', 'K2', '4.1.1 ', 1, '区别：测试设计规格说明、测试用例规格说明和测试规程规格说明', 4),
(35, '2015-12-10 11:41:00', '2015-12-10 11:41:00', 'K2', '4.1.2 ', 1, '比较术语：测试条件、测试用例和测试规程', 4),
