(84, '2019-03-04 06:11:05', '2019-03-04 06:37:34', '2019-03-07', '2019-02-26', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-03-13', '2019-03-08', '', 1, '<p><strong>开发团队正在开发一款在线交易系统，你负责其中付款功能的组件测试。</strong></p>\n<p><strong>下面关于测试付款功能的主要测试目标的描述，哪个是最恰当的？</strong></p>', 72, 1, 2, 77, 73, 9, 17, NULL, ''),
(85, '2019-03-04 06:14:00', '2019-03-04 06:37:55', '2019-03-14', '2019-03-04', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-03-14', '2019-03-06', '', 1, '<p><strong>1.你是负责某在线支付系统图形化界面测试的测试人员。你参与了该图形化界面的代码评审，在评审过程中，发现代码语句将&ldquo;总额人民币</strong><strong>RM</strong><strong>B（）元&rdquo;写成了&ldquo;总额人民币</strong><strong>RMD</strong><strong>（）元&rdquo;，即存在拼写错误。</strong></p>\n<p><strong><strong>根据</strong></strong><strong><strong>ISTQB</strong></strong><strong><strong>的术语定义，这个问题应该如何称呼最合适？（K2）</strong></strong></p>', 61, 1, 1, 77, 73, 8, 17, NULL, ''),
(101, '2019-03-06 08:42:26', '2019-03-11 01:39:05', '2019-03-13', '2019-03-11', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-03-15', '2019-03-14', '', 1, '<p>测试题目</p>', 72, 90, 1, 100, 75, 6, 2, NULL, '<p>长度测试</p>\n<p>您是旅游信息手机应用项目的测试经理。近期该项目切换到敏捷流程和测试驱动开发（TDD）。每个开发周期持续15天，在第7天之后开始每日构建。第10天以后，不会再有新的功能加入。开发团队由经验丰富的团队成员组成，他们以自己的工作为荣，但对测试团队不太友好。以粗略的用户故事形式编写需求，如下面所示：</p>\n<table>\n<tbody>\n<tr>\n<td width=\"574\">\n<p>US 03-30：查找距离最近的匹配的酒店</p>\n<p>作为不熟悉当地环境的临时客户，希望获得与经济和舒适度要求最匹配且距离最近的酒店信息。</p>\n<p>优先级：高；工作量：7（10当中的7）</p>\n</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>该软件依赖于已有的Web服务，在开发阶段通过桩代替。开发人员负责组件测试，而系统测试和验收测试是测试团队的职责。开发周期早期进行的系统测试，经常由于新开发功能存在严重问题而被阻塞。分析显示，很多此类问题应该在组件测试时就被发现。通过分析生产环境中发现的缺陷显示：30%的性能问题是由于第三方交付的Web服务不可靠造成的。</p>\n<p>主要的测试目标是缓解预想的性能风险，以及 &ldquo;优先级 &gt;= 高&rdquo;的用户故事不会出现高严重程度的失效，从而提高信心。另外，高层管理团队要求测试与开发之间紧密合作。</p>\n<p>下面哪3个测试活动/工作产品可以最好的帮助达到测试目标？</p>'),
