(255, '2019-04-02 01:04:33', '2019-04-07 10:46:01', '2019-04-07', '2019-03-28', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-29', '<p>现在天气越来越冷，周围很多同学都把衣服拿出去洗.</p>', 1, '<p>如果你在校园开一家洗衣店，请阐述你的创业思路</p>', 193, 166, 1, 191, 242, 8, 2, NULL, '<p>可以以你所在学校为例</p>'),
(256, '2019-04-02 01:05:21', '2019-04-07 10:44:47', '2019-04-07', '2019-03-28', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-29', '', 1, '<p>这个标志的含义是提醒前方两侧行车道或路面变窄。</p>', 249, 166, 1, 191, 248, 8, 3, NULL, ''),
(257, '2019-04-02 01:06:27', '2019-04-07 10:43:44', '2019-04-08', '2019-03-29', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-09', '2019-03-30', '', 1, '<p>一只蚂蚁在距巢穴2米处找到一只死苍蝇，它决定把它搬回家，可它没1分钟内前进1米，却被风刮退2米，请问这只蚂蚁能否回到巢穴？如不能，请说明理由；如能，算一算它何时能回到巢穴？<br /><br /></p>', 248, 166, 1, 191, 192, 8, 2, NULL, '<p>拓展答题者的立体思维</p>'),
(258, '2019-04-02 01:09:24', '2019-04-05 06:30:06', '2019-04-08', '2019-03-31', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-09', '2019-04-01', '<p>这是一道乘法算术题</p>', 1, '<p>520*608的结果是多少？</p>', 190, 166, 1, 191, 193, 8, 17, NULL, ''),
