(260, '2019-04-02 01:10:28', '2019-04-07 10:46:28', '2019-04-07', '2019-03-30', NULL, NULL, NULL, NULL, 2, NULL, b'1', NULL, '2019-04-08', '2019-03-31', '', 1, '<p>已知a = 0，b = 0，则下列说法正确的有（）</p>', 193, 166, 1, 191, 242, 8, 1, NULL, '<p>多选题</p>'),
(261, '2019-04-02 01:10:56', '2019-04-07 10:44:56', '2019-04-07', '2019-03-30', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-31', '', 1, '<p>很多相同的绝缘铜圆环沿竖直方向叠放,形成一很长的竖直圆筒。一条形磁铁沿圆筒的中心轴竖直放置,其下端与圆筒上端开口平齐。让条形磁铁从静止开始下落。条形磁铁在圆筒中的运动速率(&ensp;&ensp;)&ensp;</p>', 249, 166, 1, 191, 248, 8, 17, NULL, ''),
(262, '2019-04-02 01:11:26', '2019-04-07 10:46:56', '2019-04-08', '2019-03-31', NULL, NULL, NULL, NULL, 2, NULL, b'1', NULL, '2019-04-09', '2019-04-01', '', 1, '<p>猫有什么特征</p>', 242, 166, 1, 191, 190, 8, 1, NULL, ''),
(263, '2019-04-02 01:11:59', '2019-04-07 10:43:56', '2019-04-08', '2019-03-31', NULL, NULL, NULL, NULL, 2, NULL, b'1', NULL, '2019-04-09', '2019-04-01', '', 1, '<p>以下哪些成语的使用是正确的？</p>\n<p>&nbsp;</p>', 248, 166, 1, 191, 192, 8, 1, NULL, ''),
(264, '2019-04-02 01:13:23', '2019-04-05 06:30:18', '2019-04-08', '2019-03-31', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-09', '2019-04-01', '<p>这是一道脑筋急转弯</p>', 1, '<p>一位卡车司机撞倒一个骑摩托车的人，卡车司机受重伤，摩托车骑士却没事，为什么？</p>', 190, 166, 1, 191, 193, 8, 2, NULL, '<p>这题的答案：卡车司机没开车</p>'),
(265, '2019-04-02 01:13:50', '2019-04-07 10:45:07', '2019-04-07', '2019-03-30', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-31', '<p>小凡总爱迟到，每周的五天中他至少要迟到三回，迟到的原因不是堵车了，就是起床晚了，要不就是家里的早饭做得太迟了......</p>', 1, '<p>假如您是小凡的班主任，您怎样处理这个问题？</p>', 192, 166, 1, 191, 249, 8, 2, NULL, ''),
(266, '2019-04-02 01:14:23', '2019-04-07 10:47:05', '2019-04-07', '2019-03-30', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-31', '<p>小曹有五块钱，小李有十块钱，小胖有十五块钱。</p>', 1, '<p>现在，小曹用掉了三块，小李弄丢了五块，小胖氪掉了十块，问：他们一共还剩多少钱？</p>', 193, 166, 1, 191, 242, 8, 2, NULL, '<p>要有详细的解题过程</p>'),
(267, '2019-04-02 01:14:51', '2019-04-07 10:45:05', '2019-04-07', '2019-03-30', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-31', '', 1, '<p>假设您是某县供电局的专责田晓， 30岁，工作能力很强，深得领导赏识。您的上级领导是部门主任赵主任，您的三个同事分别是：小钱、小胡、小刘，同事们都称呼您为小田。<br />请您对所列出工作情景，给出相应的处理意见，具体地写出你将会采取什么样的行动步骤和措施，并阐明理由。答题过程中，不要就题目内容提问。请不要以安排给他人的形式进行处理。<br /><br />工作情景一： <br />市供电局在明天下午安排了一个技能提高培训班，赵主任希望你作为代表准时参加。由于这两天你的工作任务非常多且时间都比较紧迫，并且你的技能方面的知识掌握的已经很好了，不想去参加培训。如果去了，势必会影响目前的工作进度。面对这种情况你应如何处理？<br />1、 向赵主任汇报自己的工作情况，说明工作任务完成情况及时间都比较紧迫；<br />2、 请求赵主任安排其他同事去，或者推荐适合人选去参加培训。</p>', 249, 166, 1, 191, 248, 8, 2, NULL, '<p>一、首先表示感谢，然后指出存在的问题<br />赵主任，谢谢您让我参加明天下午市供电局的技能提高培训班，我也很想参加类似的培训，而且还可以多认识一些朋友。但是，由于这两天的工作任务非常多且时间都比较紧迫，如果我去参加培训，我担心工作进度就跟不上，怎么办呢。<br />二、提出解决问题的建议<br />为了不影响工作进度，这次培训我打算先不参加。同时，我查过了培训内容，这次培训的内容与小胡和小刘的岗位也很对口，但小刘明天有事出差，小胡明天没有事情，看能不能让小胡参加这次培训。<br />三、征求赵主任表态，然后予以落实<br />赵主任如果说不行，必须要参加市供电局的技能培训班。我马上进行协商，处理工作进度问题，然后准时参加市供电局的培训（这里要注意赵主任是我的直接领导）。如果赵主任说好的，由赵主任安排小胡参加，或者赵主任如果授权我通知，我将转告小胡参加培训。</p>'),
(268, '2019-04-02 01:15:20', '2019-04-07 10:47:23', '2019-04-08', '2019-03-31', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-09', '2019-04-01', '', 1, '<p>小明被提问狗的英语怎么说，请告诉他正确答案</p>', 242, 166, 1, 191, 190, 8, 2, NULL, ''),
(269, '2019-04-02 01:15:47', '2019-04-07 10:44:49', '2019-04-08', '2019-03-31', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-09', '2019-04-01', '', 1, '<p>一个人开着装着过期面包的货车打算拿到郊外去销毁，岂料中途进过一个小山村，村民非常饥饿，看到有车经过，还看到车里有食物，便把路给堵住了，要求给他们吃点东西，当地的记者也赶来报道这一情况，请问，司机怎么样既能把这些不会太影响身体的面包给村民吃，而又能使记者不报导出去呢？</p>', 248, 166, 1, 191, 192, 8, 2, NULL, ''),
(270, '2019-04-02 01:16:47', '2019-04-05 06:30:34', '2019-04-07', '2019-03-30', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-31', '<p>这是一道脑筋急转弯</p>', 1, '<p>孔子与孟子有什么区别?&nbsp;</p>', 190, 166, 1, 191, 193, 8, 2, NULL, '<p>这题的答案：孔子的子在左边，孟子的子在上边</p>'),
(271, '2019-04-02 01:17:30', '2019-04-07 10:45:30', '2019-04-07', '2019-03-30', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-31', '<p>小亮总是不能按时完成作业。凡是规定当堂课交的作业，王老师还能看到他的作业并及时批改；但只要需回家完成的作业，从来就见不到小亮的作业本。面对老师的询问，小亮的回答常常是：&ldquo;我做了，放在家里，忘带了。&rdquo;</p>', 1, '<p>如果您是王老师，如何教育小亮？</p>', 192, 166, 1, 191, 249, 8, 2, NULL, ''),
(272, '2019-04-02 01:18:02', '2019-04-07 14:03:50', '2019-04-07', '2019-03-30', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-31', '<p>小曹，小李，小胖吃苹果。</p>', 1, '<p>小胖拿出了五个苹果，拿走了十个；小曹拿出了七个苹果，拿走了五个；小李拿出了七个。问：小李拿走了几个苹果？</p>', 193, 166, 1, 191, 242, 8, 2, NULL, '<p>要求有详细的解题过程</p>'),
(273, '2019-04-02 01:18:35', '2019-04-07 10:45:14', '2019-04-07', '2019-03-30', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-04-08', '2019-03-31', '', 1, '<p>&ldquo;神舟&rdquo;五号飞船完成了预定空间科学和技术试验任务后，返回舱开始从太空向地&ensp; 球表面按预定轨道返回。在返回时先要进行姿态调整，飞船的返回舱与留轨舱分离，返回舱以近8km/s的速度进入大气层，当返回舱距地面30km时，返回舱上的回收发动机启动。相继完成拉出天线、抛掉底盖等动作。在飞船返回舱距地面20km以下的高度后，速度减为200m/s而匀速下降，此段过程中返回舱所受空气阻力为f=&rho;v2S/2，式中&rho;为大气的密度，v是返回舱的运动速度，S为与形状特征有关的阻力面积，当返回舱距地面高度为l0km时，打开面积为1200m2的降落伞，直到速度达到8.0m/s后匀速下落。为实现软着陆(即着陆时返。回舱的速度为0)，当返回舱离地面1.2m时反冲发动机点火，使返回舱落地的速度减为零，返回舱此时的质量为2.7&times;103kg，忽略此时的空气阻力，取g=l0m/s2.&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;&ensp;</p>\n<p>&ensp;(1)用字母表示出返回舱在速度为200m／s时的质量。&ensp; &ensp;&ensp;&ensp;&ensp;</p>\n<p>(2)定性分析把降落伞全部打开后到反冲发动机点火前，返回舱的加速度和速度的变化情况。&ensp; &ensp;&ensp;&ensp;&ensp;</p>\n<p>(3)求反冲发动机的平均反推力的大小及反冲发动机对返回舱做的功。</p>', 249, 166, 1, 191, 248, 8, 2, NULL, ''),
