(949, '2019-04-24 08:48:18', '2019-04-30 01:06:56', '2019-05-03', '2019-04-22', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-05-08', '2019-04-26', '<p>我们需要进行敏捷测试。</p>', 1, '<p>请将以下<span id=\"thread_subject\">敏捷项目中的测试活动流程进行排序：1：开发测试用例，2：制定测试计划，3：确定测试方案，4：执行测试，5：完成测试报告，6：确定系统需求和约束</span></p>', 598, 93, 2, 497, 520, 7, 3, NULL, ''),
(950, '2019-04-24 08:49:16', '2019-04-28 10:40:16', '2019-05-08', '2019-04-23', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-05-15', '2019-04-23', '<p>对敏捷术语的测试</p>', 1, '<p>下列哪一个不是敏捷开发中常用的术语？</p>', 575, 111, 2, 497, 501, 8, 498, NULL, ''),
(951, '2019-04-24 08:49:55', '2019-04-28 11:11:02', '2019-05-01', '2019-04-22', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-05-16', '2019-04-23', '<p>回顾会议作为一个迭代周期的结尾的团队活动，担负着总结工作情况，根据工作情况进行及时反馈和修正的作用。</p>', 1, '<p>回顾会议主要包括哪些过程？</p>', 520, 86, 2, 497, 759, 8, 3, NULL, '<p>一般的，回顾会议分为这么几个部分: <br />1.启动&mdash;&mdash;宣布开始，特殊事项宣布 <br />2.团队陈述&mdash;&mdash;多团队共同回顾，各个团队选一个人进行工作总结 <br />3.收集数据&mdash;&mdash;发便签纸和笔，个人回顾做的好的，做的有待改进的 <br />4.公示数据&mdash;&mdash;将每个人回顾的内容张贴在白板上，两个区域好的和改进的，大家自由讨论（15分钟），解释和讨论 <br />5.选择改进，每人3张票，进行改进措施投票，根据投票结果确定改进事项 <br />6.公布，公布需要改进的措施，并转换为任务卡 <br />7.感谢，每个人写一张感谢卡，给要感谢的人 <br />8.结束，happy end</p>'),
(952, '2019-04-24 08:50:25', '2019-04-28 06:48:21', '2019-05-13', '2019-04-23', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-05-17', '2019-04-24', '<p>考查介词的使用</p>', 1, '<p>My&nbsp;birthday&nbsp;is&nbsp; &mdash;&mdash;&nbsp;june</p>', 501, 83, 2, 497, 598, 8, 698, NULL, ''),
(953, '2019-04-24 08:51:00', '2019-05-06 12:04:35', '2019-05-22', '2019-04-22', NULL, NULL, NULL, NULL, 2, NULL, b'1', NULL, '2019-05-29', '2019-04-24', '<p>在敏捷团队中,测试是整个项目组的&ldquo;车头灯&rdquo;，它告诉大家现在到哪了，正在往哪个方向走。测试员为项目组提供丰富的信息，使得项目组基于这些可靠的信息作出正确的决定。不仅是测试员要保证质量，而是整个项目组的每一个人都要对质量负责。测试员不跟开发人员纠缠错误，而是帮助他们找到目标,共同为达到项目的最终目标而努力。</p>', 1, '<p>敏捷测试也需要高度迭代工作、频繁得到客户的反馈，需要动态调整测试计划、测试的执行。并且，敏捷测试人员参与到了更多的敏捷生产活动中，积极的影响了团队做出的决定和计划，你觉得测试自动化会给高度迭代测试带来什么好处？</p>', 520, 93, 699, 497, 598, 8, 698, NULL, '<p>这是一道开放性问题，请自由发挥</p>'),
