(961, '2019-04-24 08:54:58', '2019-04-28 11:21:20', '2019-05-29', '2019-04-23', NULL, NULL, NULL, NULL, 2, NULL, b'0', NULL, '2019-05-29', '2019-04-26', '<p>Ham 是德国 ThoughtWorks 的一名软件开发和咨询师。由于厌倦了在凌晨 3 点手动部署软件，他开始持续交付实践，加紧自动化步伐，并着手帮助团队高效可靠地交付高质量软件。这样他就可以把省出来的时间用在别的有趣的事情上了。他提出了软件测试金子塔的概念。</p>', 1, '<p>以下哪个是正确的软件测试金字塔的概念？</p>', 496, 97, 1, 497, 575, 8, 2, NULL, '');
