(859, '2019-04-23 13:27:14', '2019-04-23 13:27:14', 'B', '<p>测试设计过程输出的是各测试阶段的测试用例，其结果可以作为各阶段的测试计划的附件提交评审</p>', b'1', 806),
(860, '2019-04-23 13:27:26', '2019-04-23 13:27:26', 'C', '<p>配置管理对象包括测试计划、测试方案（用例）、测试版本、测试工具、测试环境、测试结果等</p>', b'1', 806),
(861, '2019-04-23 13:27:36', '2019-04-23 13:27:36', 'D', '<p>本地化测试由本地化提供商的测试项目组成员完成，需要与软件供应商有效协作，获得最新的测试用例和测试软件，提交测试结果（软件错误数据库和测试报告等）</p>', b'1', 806),
(862, '2019-04-23 13:28:06', '2019-04-23 13:28:06', 'A', '<p>编写合理的测试计划，并与项目整体计划有机地整合在一起</p>', b'1', 807),
