(867, '2019-04-23 13:29:50', '2019-04-23 13:29:50', 'B', '<p>选择型是指由某个逻辑判断式的取值决定选择两个处理中的一个</p>', b'1', 808),
(868, '2019-04-23 13:30:00', '2019-04-23 13:30:00', 'C', '<p>N-S图从表达形式上就排除了随意使用控制转移对程序流程的影响，限制了不良程序结构的产生</p>', b'1', 808),
(869, '2019-04-23 13:30:08', '2019-04-23 13:30:08', 'D', '<p>PAD图是表现程序逻辑结构的图形工具</p>', b'1', 808),
