(874, '2019-04-23 13:34:40', '2019-04-23 13:34:40', 'A', '<p>&beta;&ensp;测试就是在软件公司内部展开的测试，由公司专业的测试人员执行的测试</p>', b'1', 810),
(875, '2019-04-23 13:34:55', '2019-04-23 13:34:55', 'B', '<p>&beta;&ensp;测试就是在软件公司内部展开的测试，由公司的非专业测试人员执行的测试</p>', b'1', 810),
(876, '2019-04-23 13:35:05', '2019-04-23 13:35:05', 'C', '<p>&beta;&ensp;测试就是在软件公司外部展开的测试，由专业的测试人员执行的测试</p>', b'1', 810),
(877, '2019-04-23 13:35:16', '2019-04-23 13:35:16', 'D', '<p>&ensp;&beta;&ensp;测试就是在软件公司外部展开的测试，可以由非专业的测试人员执行的测试</p>', b'0', 810),
(878, '2019-04-23 13:35:59', '2019-04-23 13:35:59', 'A', '<p>保证一个模块中的所有独立路径至少被使用一次</p>', b'1', 811),
(879, '2019-04-23 13:36:08', '2019-04-23 13:36:08', 'B', '<p>对所有逻辑值均需测试&ensp;true&ensp;和&ensp;false</p>', b'1', 811),
(880, '2019-04-23 13:36:18', '2019-04-23 13:36:18', 'C', '<p>在上下边界及可操作范围内运行所有循环</p>', b'1', 811),
(881, '2019-04-23 13:36:58', '2019-04-23 13:36:58', 'D', '<p>检查内部数据结构以确保其有效性</p>', b'1', 811),
(883, '2019-04-23 15:09:14', '2019-04-23 15:20:32', 'A', '<p>存储压力</p>', b'1', 778),
