(885, '2019-04-23 15:10:39', '2019-04-23 15:43:47', 'C', '<p>&nbsp;网络流量压力</p>', b'1', 778),
(886, '2019-04-23 15:10:48', '2019-04-23 15:10:48', 'D', '<p>并发压力</p>', b'0', 778),
(887, '2019-04-23 15:11:45', '2019-04-23 15:44:03', 'A', '<p>软件需求分析说明书中定义的所有功能已全部实现，性能指标全部达到要求。</p>', b'1', 782),
(888, '2019-04-23 15:11:57', '2019-05-01 07:38:03', 'B', '<p>所有测试项没有残余一级、二级和三级错误。</p>', b'1', 782),
(889, '2019-04-23 15:12:07', '2019-05-01 07:38:08', 'C', '<p>立项审批表、需求分析文档、设计文档和编码实现一致。</p>', b'1', 782),
(890, '2019-04-23 15:12:31', '2019-05-01 07:38:14', 'D', '<p>验收测试工件齐全。</p>', b'1', 782),
(891, '2019-04-23 15:14:32', '2019-05-01 07:39:35', 'A', '<p>TDD的原理是在开发功能代码之前，先编写单元测试用例代码，测试代码确定需要编写什么产品代码</p>', b'1', 783),
(892, '2019-04-23 15:14:53', '2019-05-01 07:39:44', 'B', '<p>TDD的基本思路就是通过测试来推动整个开发得进行，但测试驱动开发并不只是单纯的测试工作，而是把需求分析，设计，质量控制量化的过程。</p>', b'1', 783),
(893, '2019-04-23 15:15:07', '2019-05-01 07:39:49', 'C', '<p>TDD的重要目的不仅仅是测试软件，测试工作保证代码质量仅仅是其中一部分，而且是在开发过程中帮助客户和程序员去除模棱两可的需求。</p>', b'1', 783),
(894, '2019-04-23 15:15:19', '2019-05-01 07:39:55', 'D', '<p>TDD首先考虑使用需求（对象、功能、过程、接口等），主要是编写测试用例框架对功能的过程和接口进行设计，而测试框架可以持续进行验证。</p>', b'1', 783),
(895, '2019-04-23 15:16:50', '2019-05-01 07:41:56', 'A', '<p>正式验收测试&nbsp;</p>', b'1', 784),
(896, '2019-04-23 15:17:01', '2019-04-23 15:17:01', 'B', '<p>白盒测试</p>', b'0', 784),
(897, '2019-04-23 15:17:12', '2019-05-01 07:42:03', 'C', '<p>alpha测试</p>', b'1', 784),
(898, '2019-04-23 15:17:24', '2019-05-01 07:42:08', 'D', '<p>beta测试</p>', b'1', 784),
(899, '2019-04-23 15:18:13', '2019-05-01 07:43:46', 'A', '<p>负载测试</p>', b'1', 785),
(900, '2019-04-23 15:18:22', '2019-05-01 07:44:00', 'B', '<p>易用性测试</p>', b'1', 785),
(901, '2019-04-23 15:18:33', '2019-05-01 07:44:09', 'C', '<p>强度测试&nbsp;</p>', b'1', 785),
(902, '2019-04-23 15:18:42', '2019-05-01 07:44:16', 'D', '<p>安全测试</p>', b'1', 785),
(903, '2019-04-23 15:19:35', '2019-04-23 15:19:35', 'A', '<p>软件测试计划</p>', b'1', 786),
(904, '2019-04-23 15:19:44', '2019-04-23 15:19:44', 'B', '<p>可行性研究报告</p>', b'0', 786),
(905, '2019-04-23 15:19:53', '2019-04-23 15:19:53', 'C', '<p>软件需求规范</p>', b'1', 786),
(906, '2019-04-23 15:20:05', '2019-04-23 15:20:05', 'D', '<p>迭代计划</p>', b'1', 786),
(907, '2019-04-23 15:23:39', '2019-04-23 15:23:39', 'A', '<p>软件测试是使用人工操作或者软件自动运行的方式来检验它是否满足规定的需求或弄清预期结果与实际结果之间的差别的过程。</p>', b'1', 787),
(908, '2019-04-23 15:23:50', '2019-04-23 15:23:50', 'B', '<p>软件测试的测试目标是发现一些可以通过测试避免的开发风险。</p>', b'1', 787),
(909, '2019-04-23 15:24:04', '2019-04-23 15:24:04', 'C', '<p>&nbsp;软件测试的原则之一是测试应该尽早进行，最好在需求阶段就开始介入。</p>', b'1', 787),
(910, '2019-04-23 15:24:14', '2019-04-23 15:24:14', 'D', '<p>软件测试主要工作内容是验证（verification）和确认（validation）</p>', b'1', 787),
(911, '2019-04-23 15:25:28', '2019-04-23 15:25:28', 'A', '<p>&nbsp;构建的确认过程</p>', b'1', 788),
(912, '2019-04-23 15:25:42', '2019-04-23 15:25:42', 'B', '<p>&nbsp;系统集成测试测试组提交过程</p>', b'1', 788),
(913, '2019-04-23 15:25:51', '2019-04-23 15:25:51', 'C', '<p>测试用例设计过程</p>', b'1', 788),
(914, '2019-04-23 15:26:02', '2019-04-23 15:26:02', 'D', '<p>Bug的报告过程</p>', b'1', 788),
(915, '2019-04-23 15:28:18', '2019-04-23 15:28:18', 'A', '<p>仔细阅读，跟随每个步骤，检查每个图形，尝试每个示例</p>', b'1', 789),
(916, '2019-04-23 15:28:29', '2019-04-23 15:28:29', 'B', '<p>检查文档的编写是否满足文档编写的目的</p>', b'1', 789),
(917, '2019-04-23 15:28:48', '2019-04-23 15:28:48', 'C', '<p>内容是否齐全，正确，完善</p>', b'1', 789),
(918, '2019-04-23 15:29:03', '2019-04-23 15:29:03', 'D', '<p>标记是否正确</p>', b'1', 789),
(919, '2019-04-23 15:29:42', '2019-04-23 15:29:42', 'A', '<p>负载测试：在一定的工作负荷下，系统的负荷及响应时间。</p>', b'1', 790),
(920, '2019-04-23 15:29:54', '2019-04-23 15:29:54', 'B', '<p>强度测试：在一定的负荷条件下，在较长时间跨度内的系统连续运行给系统性能所造成的影响。</p>', b'1', 790),
(921, '2019-04-23 15:30:04', '2019-04-23 15:30:04', 'C', '<p>容量测试：容量测试目的是通过测试预先分析出反映软件系统应用特征的某项指标的极限值（如最大并发用户数、数据库记录数等），系统在其极限值状态下没有出现任何软件故障或还能保持主要功能正常运行。</p>', b'1', 790),
(922, '2019-04-23 15:30:17', '2019-04-23 15:30:17', 'D', '<p>&nbsp;容量测试是面向数据的，并且它的目的是显示系统可以处理目标内确定的数据容量。</p>', b'1', 790),
(923, '2019-04-23 15:31:03', '2019-04-23 15:31:03', 'A', '<p>JMeter: 基于JAVA的压力测试工具，Badboy用来进行脚本的录制</p>', b'1', 791),
(924, '2019-04-23 15:31:14', '2019-04-23 15:31:14', 'B', '<p>Junit: 白盒测试工具：针对代码测试</p>', b'1', 791),
